    const center = 128;
    const testDist = 110; // Near edge of bezel (radius=128, bezel starts ~90)

    // 8 directions at same distance
    const angles = [0, 45, 90, 135, 180, 225, 270, 315];

    angles.forEach((deg) => {
      const rad = (deg * Math.PI) / 180;
      const x = Math.round(center + Math.cos(rad) * testDist);
      const y = Math.round(center + Math.sin(rad) * testDist);
      const idx = (y * 256 + x) * 4;

      const r = imageData.data[idx];
      const g = imageData.data[idx + 1];

      // Calculate magnitude from color
      const dx = (r - 128) / 127;
      const dy = (g - 128) / 127;
      const mag = Math.sqrt(dx * dx + dy * dy);

      console.log(`${deg}°: RGB(${r},${g}) → magnitude=${mag.toFixed(3)}`);
    });
